import PropTypes from 'prop-types';
import './Today.css';

export default class Today extends React.Component {
    static propTypes = {
        unit: PropTypes.string,
        searchText: PropTypes.string,
        onUnitChange: PropTypes.func
    };

    constructor(props) {
        super(props);
    }
    render() {
        return (
            <p>today is gonna be a good day to you!</p>
        );
    }
}
